import axios from "axios";
import React, { useState, useRef, useEffect } from "react";

export default function EditarInstitucion({ institucion, onInstitucionEdited }) {
  const modalRef = useRef(null);

  const [institucionState, setInstitucionState] = useState({
    idInstitucion: "",
    nombreInstitucion: "",
    direccionInstitucion: "",
    telefonoInstitucion: "",
    codigoPostal: "",
  });

  useEffect(() => {
    if (institucion) {
      setInstitucionState(institucion);
    }
  }, [institucion]);

  const {
    idInstitucion,
    nombreInstitucion,
    direccionInstitucion,
    telefonoInstitucion,
    codigoPostal,
  } = institucionState;

  const onInputChange = (e) => {
    setInstitucionState({ ...institucionState, [e.target.name]: e.target.value });
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    const urlBase = `http://localhost:8080/sipress-app/instituciones/${idInstitucion}`;
    await axios.put(urlBase, institucionState);

    // Cerrar el modal manualmente
    const modalElement = modalRef.current;
    if (modalElement) {
      const modalInstance = new window.bootstrap.Modal(modalElement);
      modalInstance.hide();
    }

    // Llamar a la función de actualización de la lista
    onInstitucionEdited();
  };

  return (
    <div
      className="modal fade"
      id="EditarInstitucionModal"
      tabIndex="-1"
      aria-labelledby="EditarInstitucionModalLabel"
      aria-hidden="true"
      ref={modalRef}>
      <div className="modal-dialog modal-lg">
        <div className="modal-content bg-light">
          <div className="modal-header">
            <h1 className="modal-title fs-5" id="EditarInstitucionModalLabel">
              Editar Institución
            </h1>
            <button
              type="button"
              className="btn-close"
              data-bs-dismiss="modal"
              aria-label="Close">
              <span></span>
            </button>
          </div>
          <form onSubmit={onSubmit}>
            <div className="modal-body">
              <div className="form-floating form-group mb-3">
                <input
                  type="text"
                  className="form-control"
                  id="idInstitucion"
                  name="idInstitucion"
                  placeholder="ID Institución"
                  required={true}
                  value={idInstitucion}
                  onChange={onInputChange}
                  readOnly
                />
                <label htmlFor="idInstitucion">ID de la Institución</label>
              </div>

              <div className="form-floating form-group mb-3">
                <input
                  type="text"
                  className="form-control"
                  id="nombreInstitucion"
                  name="nombreInstitucion"
                  placeholder="Nombre de la Institución"
                  required={true}
                  value={nombreInstitucion}
                  onChange={onInputChange}
                />
                <label htmlFor="nombreInstitucion">
                  Nombre de la Institución
                </label>
              </div>

              <div className="form-floating form-group mb-3">
                <input
                  type="text"
                  className="form-control"
                  id="direccionInstitucion"
                  name="direccionInstitucion"
                  placeholder="Dirección"
                  required={true}
                  value={direccionInstitucion}
                  onChange={onInputChange}
                />
                <label htmlFor="direccionInstitucion">
                  Dirección de la Institución
                </label>
              </div>

              <div className="form-floating form-group mb-3">
                <input
                  type="tel"
                  className="form-control"
                  id="telefonoInstitucion"
                  name="telefonoInstitucion"
                  placeholder="Teléfono de la Institución"
                  required={true}
                  value={telefonoInstitucion}
                  onChange={onInputChange}
                />
                <label htmlFor="telefonoInstitucion">
                  Teléfono de la Institución
                </label>
              </div>

              <div className="form-floating form-group mb-3">
                <input
                  type="text"
                  className="form-control"
                  id="codigoPostal"
                  name="codigoPostal"
                  placeholder="Código Postal"
                  required={true}
                  value={codigoPostal}
                  onChange={onInputChange}
/>
<label htmlFor="codigoPostal">Código Postal</label>
</div>
</div>
<div className="modal-footer">
<button
             type="button"
             className="btn btn-secondary"
             data-bs-dismiss="modal">
Cancelar
</button>
<button
             type="submit"
             className="btn btn-primary"
             data-bs-dismiss="modal">
Guardar cambios
</button>
</div>
</form>
</div>
</div>
</div>
);
}
